import React from "react";
import "./Quiz.css";
import TimerHeader from "./TimerHeader";
import QuestionCard from "./QuestionCard";

function Quiz(){
    const quiz = [
        {
            question: "Superposition principle can not be applied to these quantities in electrostatics.",
            options: ["Electrostatic energy", "Electric Field", "Electric Potential", "Electric force"],
            answer: "1. Electrostatic energy"
        },
        {
            question: "Two conducting charged spheres X and Y having unequal charges are connected by the " +
                "wire. Which of the following is true?",
            options: ["Charge is conserved", "Electrostatic energy is conserved", "Electric Potential", "Electric force"],
            answer: "1. Electrostatic energy"
        }
    ];
    return(
        <div>
            <TimerHeader/>
            <QuestionCard/>
        </div>
    );
}

export default Quiz;
